"120142":{"id":"120142","name":"SABIKUI BISCO","slug":"sabikui-bisco","original_title":"錆喰いビスコ","overview":"O Japão foi devastado pelo Vento da Ferrugem, que enferruja a tudo e todos, corroendo tanto as cidadas quanto seus moradores. Para salvar seu mestre moribundo, um jovem chamado Bisco Akaboshi parte numa jornada para encontrar o milagroso Cogumelo Come-Ferrugem, capaz de eliminar todo tipo de ferrugem. No caminho, ele encontra um jovem doutor chamado Milo Nekoyanagi, que estuda uma maneira de curar a ferrugem que consome sua querida irmã mais velha.","first_air_date":"2022-01-11","episode_run_time":24,"vote_average":6.4,"number_of_seasons":2,"number_of_episodes":13,"created_by":[],"production_companies":["OZ","KADOKAWA","Hakuhodo DY Music & Pictures","FlyingDog","Yomiuri Telecasting Corporation","Frontier Service","BS11","THE KLOCKWORX","Bit grooove promotion"],"genres":["Animação","Action & Adventure","Comédia","Sci-Fi & Fantasy"],"certification":"N/A","backdrop_path":"https://image.tmdb.org/t/p/original/1PjeMinKDUgHaWyFdlkCXKlDZnb.jpg","poster_path":"https://image.tmdb.org/t/p/original/hT9DTlUZxyq96Kuo0b9yEGYZrj9.jpg","cast":["Ryota Suzuki","Natsuki Hanae","近藤玲奈","Miyu Tomita","斎藤志郎"],"trailer":"OLhC78eHau4","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/dy8f1zDJkt8RgZO00FrHVHgypt3.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/dy8f1zDJkt8RgZO00FrHVHgypt3.jpg","air_date":"2022-01-11","episode_count":12,"overview":"O Japão foi devastado pelo Vento da Ferrugem, que enferruja a tudo e todos, corroendo tanto as cidades quanto seus moradores. Para salvar seu mestre moribundo, um jovem chamado Bisco Akaboshi parte numa jornada para encontrar o milagroso Cogumelo Come-Ferrugem, capaz de eliminar todo tipo de ferrugem. No caminho, ele encontra um jovem doutor chamado Milo Nekoyanagi, que estuda uma maneira de curar a ferrugem que consome sua querida irmã mais velha.","vote_average":7.1,"episodes":{"1":{"name":"O homem que vale 800.000","overview":"Em uma era pós-apocalíptica, uma doença chamada Ferrugem assola a humanidade. Mesmo em uma situação desesperadora, há quem jamais desista de ajudar aqueles ao seu redor.","air_date":"2022-01-11","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/6FMtLq5BtNZgeHBgglW2jdTCZAE.jpg","vote_average":6.9},"2":{"name":"Saltando com o Eringui","overview":"Bisco invade a casa de Milo, médico que estava sintetizando diversos materiais para criar um remédio que ainda não existe. O tal \"Comedor de Gente\" se mostra com pressa.","air_date":"2022-01-18","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/uRDWfRMSjNvB26sgPCOsTUh3iK1.jpg","vote_average":7.2},"3":{"name":"Time","overview":"Enquanto Milo cuida de Jabi, Bisco se envolve em uma nova batalha e precisará enfrentar a Capitã Pawoo.","air_date":"2022-01-25","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/sIjkvSqD2bTg9Y2JtJYY431UREV.jpg","vote_average":7.7},"4":{"name":"Montar em um Caranguejo","overview":"Depois de muita discussão, Bisco aceita que Nekoyanagi, o médico Panda, seja seu parceiro na jornada. Contudo, o jovem doutor tem muita coisa para aprender.","air_date":"2022-02-01","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/zpIt3BAwuf476BZH4fGB24Rwblv.jpg","vote_average":7.5},"5":{"name":"Forte das crianças","overview":"Bisco e Panda, sem suprimentos, chegam até uma cidade repleta de crianças. Sem opções de como ganhar a confiança delas, Bisco resolve a situação de forma um pouco inusitada.","air_date":"2022-02-08","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/5DRIomioD80neN0Dd3kJ4ZDOe6F.jpg","vote_average":7.2},"6":{"name":"Companheiros e presa","overview":"Depois de deixar o forte repleto de crianças, Milo e Bisco seguem em viagem rumo à Akita para conseguir o lendário cogumelo Devorador de Ferrugem, mas parece que o clima extremamente frio do local é um obstáculo a ser superado com maior prioridade.","air_date":"2022-02-15","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/svWZfALTDJqsO2U9n2WBhxfvieF.jpg","vote_average":7},"7":{"name":"O devorador de ferrugem roubado","overview":"Justo quando Bisco e Milo encontram o suposto monstro que faz Devoradores de Ferrugem crescerem, Pawoo aparece e está disposta a brigar com Akaboshi para recuperar seu irmão.","air_date":"2022-02-22","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/m77yvPl8Z9IKeptO2vGj4QbrhFF.jpg","vote_average":7.3},"8":{"name":"A armadilha de um canalha","overview":"Depois de ver o anúncio oficial do Governador Kurokawa, Milo resolve voltar para Imihama e resgatar sua irmã sem a ajuda de Bisco.","air_date":"2022-03-01","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/q091IuoK0lSpedXSvN6tfEXWQfn.jpg","vote_average":6},"9":{"name":"Eu te amo","overview":"Depois de um embate violento com Kurokawa, Bisco e Milo conseguem fugir. Bisco trata imediatamente os ferimentos de seu amigo panda, que se sente inseguro, pois teme as futuras ações de seu parceiro.","air_date":"2022-03-08","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/cBOxES5O7WLV9OuvGnwEYx3IgJh.jpg","vote_average":7.5},"10":{"name":"Tetsujin revivido","overview":"Depois de acabar com o Governador Kurokawa, Milo, a contragosto, retira a vida de seu companheiro, mas ainda há uma coisa que ele precisa fazer.","air_date":"2022-03-15","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/c8SACuJoRz6GaNsprj8rgxbTnoR.jpg","vote_average":7},"11":{"name":"Eu sou Bisco!","overview":"Com a ativação inesperada do Tetsujin, todos estão correndo para impedi-lo de espalhar mais uma vez a terrível Ferrugem pelo país. Milo mostra resistência, assim como seu amigo sempre demonstrou.","air_date":"2022-03-22","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/6xSJKdL3Idt4GxJdT9Uwc5zf323.jpg","vote_average":7},"12":{"name":"Os dois arqueiros","overview":"Depois de uma árdua, quando todos achavam que não era possível ganhar do Tetsujin, Bisco ressurge com poderes inimagináveis.","air_date":"2022-03-29","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/tp4Pw8eupxsv6hXkt2i8jVrsZHQ.jpg","vote_average":7}}},"2":{"name":"Temporada 2","poster_path":"https://image.tmdb.org/t/p/originalnull","backdrop_path":"https://image.tmdb.org/t/p/originalnull","air_date":"N/A","episode_count":1,"overview":"N/A","vote_average":0,"episodes":{"1":{"name":"Episódio 1","overview":"N/A","air_date":"N/A","runtime":0,"still_path":"https://image.tmdb.org/t/p/originalnull","vote_average":0}}}}},
