"206630":{"id":"206630","name":"Sasaki and Peeps","slug":"sasaki-and-peeps","original_title":"佐々木とピーちゃん","overview":"Sasaki é um funcionário de escritório de meia-idade que vive no Japão. Sentindo-se esgotado pelo enfadonho mundo corporativo, ele vai a um pet shop em busca de um novo companheiro. Lá, ele encontra um adorável pássaro chamado \"Peeps\" e decide levá-lo para casa. Mas Sasaki percebe rapidamente que Peeps não é um pássaro comum... ele é um mago poderoso de outro mundo! Juntos, eles embarcam em uma aventura mágica cheia de espadas e feitiçaria.","first_air_date":"2024-01-05","episode_run_time":0,"vote_average":7,"number_of_seasons":2,"number_of_episodes":12,"created_by":[],"production_companies":["SILVER LINK.","KADOKAWA","GREE Entertainment","AT-X","Crunchyroll","Sammy","Nippon Columbia"],"genres":["Animação","Comédia","Sci-Fi & Fantasy"],"certification":"14","backdrop_path":"https://image.tmdb.org/t/p/original/xljpEwFQF6Rl1rU1w7SEs1pk3YE.jpg","poster_path":"https://image.tmdb.org/t/p/original/m3D7giT0fyJJ5ssjOEhYgUXN7Sg.jpg","cast":["Tomokazu Sugita","Aoi Yuki","Rie Takahashi","Akari Kito","Miyu Tomita"],"trailer":"N/A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/m3D7giT0fyJJ5ssjOEhYgUXN7Sg.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/m3D7giT0fyJJ5ssjOEhYgUXN7Sg.jpg","air_date":"2024-01-05","episode_count":12,"overview":"N/A","vote_average":7.3,"episodes":{"1":{"name":"Este e o outro mundo","overview":"Sasaki é um assalariado comum, que ganha pouco em uma empresa pequena, mas sua vida muda de forma drástica após um certo encontro...","air_date":"2024-01-05","runtime":48,"still_path":"https://image.tmdb.org/t/p/original/wieOzsGCLDaxZLJ3sIx1uLsmjj9.jpg","vote_average":6.5},"2":{"name":"Primeiro trabalho e uma parceira","overview":"Sasaki agora faz parte de uma agência secreta do governo e, com isso, ele tem novos deveres a serem cumpridos, como a busca e captura de pessoas que possuem poderes paranormais.","air_date":"2024-01-12","runtime":23,"still_path":"https://image.tmdb.org/t/p/original/avld1DbKFy72Jl6roIyFJik49tH.jpg","vote_average":7},"3":{"name":"A guerra e a jovem","overview":"Uma guerra se aproxima e causa transtornos a todos no reino, principalmente com o aumento dos preços de alimentos e mercadorias. Mesmo relutante, Sasaki pode acabar envolvido nos problemas desse conflito.","air_date":"2024-01-19","runtime":23,"still_path":"https://image.tmdb.org/t/p/original/l7aERvSE6mI7VRQFlIUWOtASjPO.jpg","vote_average":6},"4":{"name":"O príncipe e o grande sábio","overview":"Peeps pede ajuda a Sasaki para interferir na guerra após vários incidentes inaceitáveis que direcionam ao fim do Clã Müller.","air_date":"2024-01-26","runtime":23,"still_path":"https://image.tmdb.org/t/p/original/vPhhlvFnzrfCUQxDQhlsjRbVgMV.jpg","vote_average":7},"5":{"name":"Homem de meia-idade mágico e um terceiro mundo","overview":"Sasaki volta do outro mundo e já precisa entrar em ação para recrutar um novo paranormal. Mas ele encontra muitas outras pessoas e problemas com isso.","air_date":"2024-02-02","runtime":23,"still_path":"https://image.tmdb.org/t/p/original/sgaoNxU0kJe5SJSFxjj7i9cwH5Y.jpg","vote_average":7},"6":{"name":"Entrevista e agrado","overview":"Um pedido inusitado vindo de Futari Shizuka dá início a muitas mudanças para Sasaki. Mas ele tem dúvidas se será para melhorar sua vida.","air_date":"2024-02-09","runtime":23,"still_path":"https://image.tmdb.org/t/p/original/egIOnR73uPhCv04xBnXTnGY48AP.jpg","vote_average":8},"7":{"name":"Força marcial e política","overview":"A guerra mal acabou e já há sinais de um novo conflito que vai acontecer, entre a nobreza e realeza, na disputa pelo trono. Pessoas do círculo de amizade de Sasaki e Peeps já sofrem os efeitos.","air_date":"2024-02-13","runtime":23,"still_path":"https://image.tmdb.org/t/p/original/u4pGiIcVZN7OASkJSoFuQpwVVct.jpg","vote_average":8},"8":{"name":"Conceitos e turismo","overview":"Uma presença clandestina faz Sasaki temer muito pelo que pode acontecer de agora em diante, mas quem testemunha tudo também será um grande problema a ser enfrentado.","air_date":"2024-02-23","runtime":23,"still_path":"https://image.tmdb.org/t/p/original/vqhzxePHjF5EfQwsz7LF9W86gJF.jpg","vote_average":8},"9":{"name":"Execução e negociação","overview":"A situação de Marc está cada vez pior com o anúncio de sua sentença. Sasaki precisa se apressar para salvar o amigo.","air_date":"2024-03-01","runtime":23,"still_path":"https://image.tmdb.org/t/p/original/q1rgkoSwN4epVcYk8kiD9vmO0ef.jpg","vote_average":7},"10":{"name":"Valor e dignidade","overview":"Chega o dia do prazo final para que Sasaki consiga evitar que Marc perca a vida. Para isso ele terá que persuadir o Conde Dietrich a libertar o amigo.","air_date":"2024-03-08","runtime":23,"still_path":"https://image.tmdb.org/t/p/original/jHyaKPU1QpgtpRw91x5KLMpwrc4.jpg","vote_average":7},"11":{"name":"Ilusão e Estratégia","overview":"Sasaki e Peeps vão salvar Futari Shizuka e se deparam com um ataque feroz. A saída da nova aliada deixou insatisfeita a antiga organização dela.","air_date":"2024-03-15","runtime":23,"still_path":"https://image.tmdb.org/t/p/original/cos0Y7VmhxYBoxauVljxhM5cDIU.jpg","vote_average":8},"12":{"name":"Mundo moderno, outro mundo e um quarto mundo","overview":"Sasaki e Furtari Shizuka saem apressados para atender ao chamado de ajuda de Hoshizaki. A situação precisa ser controlada e serve de chance para que Futari Shizuka seja oficialmente aceita na agência.","air_date":"2024-03-22","runtime":23,"still_path":"https://image.tmdb.org/t/p/original/opnKolPR0aH83yKfa6AvC92FOb.jpg","vote_average":8}}},"2":{"name":"Temporada 2","poster_path":"https://image.tmdb.org/t/p/originalnull","backdrop_path":"https://image.tmdb.org/t/p/originalnull","air_date":"N/A","episode_count":0,"overview":"N/A","vote_average":0,"episodes":{}}}},
