"158293":{"id":"158293","name":"Shinobi no Ittoki","slug":"shinobi-no-ittoki","original_title":"忍の一時","overview":"Ittoki Sakuraba era um estudante normal até descobrir que é o 19º herdeiro do famoso clã ninja dos Iga, e que sua vida e suas posses estão sendo ameaçadas pelos Koga, um clã ninja rival. Ittoki agora precisa se tornar um ninja forte o bastante para proteger a si mesmo e sua vila. Para isso, ele se matricula na Academia Ninja Kokuten, um colégio especializado em técnicas ninja modernas, incluindo apetrechos e vestes de alta tecnologia. Junto com estudantes de outras vilas, Ittoki confronta os Koga numa tentativa de acabar de vez com a rivalidade.","first_air_date":"2022-10-04","episode_run_time":24,"vote_average":6.5,"number_of_seasons":1,"number_of_episodes":12,"created_by":[],"production_companies":["TROYCA","DMM pictures","DMM music","NetEase Games","TMS Entertainment","TOY'S FACTORY"],"genres":["Animação","Action & Adventure"],"certification":"14","backdrop_path":"https://image.tmdb.org/t/p/original/9DidWNT1fkqeKu2SpSjgo1iUZUg.jpg","poster_path":"https://image.tmdb.org/t/p/original/xuqsm5RM9cJYloufbqxvPR4P3NX.jpg","cast":["Ryota Osaka","Katsuyuki Konishi","Haruka Shiraishi","井上喜久子","Aoi Yuki"],"trailer":"N/A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/xuqsm5RM9cJYloufbqxvPR4P3NX.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/xuqsm5RM9cJYloufbqxvPR4P3NX.jpg","air_date":"2022-10-04","episode_count":12,"overview":"N/A","vote_average":6.7,"episodes":{"1":{"name":"Trovão no Céu Azul","overview":"Ittoki, um jovem no início de sua adolescência cheio de vontade de curtir com seus amigos, porém sua mãe leva sua educação à sério e é muito rígida com seus estudos, o que o deixa frustrado com a vida.","air_date":"2022-10-04","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/7OCsKy54TuZo3HuEZViwhOZ4niA.jpg","vote_average":5.2},"2":{"name":"Escolhas Sem Misericórdia","overview":"Depois de algumas tentativas de homicídio, Ittoki descobre a verdade por trás de sua família e precisa tomar uma decisão muito importante para seu futuro.","air_date":"2022-10-11","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/XKJh3g7QkJW6ItBmbydDXFyeP1.jpg","vote_average":6.5},"3":{"name":"Peculiaridades do Destino","overview":"Ittoki consegue passar no teste para se transferir para a Academia de Ninjas Kokuten e se despede de seus amigos com muito pesar.","air_date":"2022-10-18","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/6dwrUsFBqihV9KI1yEBcBIr2Lpt.jpg","vote_average":7},"4":{"name":"Criadores e Usuários","overview":"O CNMSN está conduzindo a investigação sobre o assassinato do líder de Koga, mas a falta de evidências é algo que dificulta o andamento.","air_date":"2022-10-25","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/soZtWXrJvcxFJ0jbKc1wL13N8EJ.jpg","vote_average":6},"5":{"name":"Ciclo da Dor","overview":"Chega mais uma prova prática e Ittoki precisa se preparar não só para o teste, mas também para possíveis ataques dos Koga. Kousetsu se dispõe a fazer de tudo, mas o futuro chefe não concorda com seu jeito de pensar.","air_date":"2022-11-01","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/xE1V8L2d3YXz1rKxLxURVjusytP.jpg","vote_average":6},"6":{"name":"Sombra e Calor","overview":"Finalmente chegam as férias de verão e Ittoki vai viver algo que jamais achou que aconteceria: vai passar as férias com amigos.","air_date":"2022-11-08","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/O0cE9aqxzfjXygib5PmTDrBR7m.jpg","vote_average":7},"7":{"name":"Onde Jaz a Justiça?","overview":"Quando as férias de verão estavam prestes a acabar, Ittoki e os demais recebem um aviso de que a escola ficará em recesso por mais um tempo, mas o motivo não parece fazer sentido.","air_date":"2022-11-15","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/viEuU7CPgYNlRdThPEKUnfzj8Py.jpg","vote_average":7},"8":{"name":"O Crepúsculo Traz a Tempestade","overview":"Depois que Karajishi deu um jeito em Goshogawara, ele assume a liderança do CNMSN e resolve as questões em aberto de Koga e Iga de forma parcial.","air_date":"2022-11-22","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/qM6uGyvF5EQHxqhKiKIQjcPTwMo.jpg","vote_average":7},"9":{"name":"O Que o Amanhecer Ilumina","overview":"O ataque à Vila Iga continua intensa. Ittoki e os demais no QG central tentando pensar em estratégias para superar os inimigos que estão em maior quantidade.","air_date":"2022-11-29","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/tDlpHTNau5mp5EWw8jzqAdheRJo.jpg","vote_average":7},"10":{"name":"Aqueles Que Foram Roubados","overview":"No dia seguinte do ataque, várias notícias de anormalidades acontecendo em diversas regiões do país revelam para o mundo ninja o ataque em massa de Koga em várias vilas de shinobis.","air_date":"2022-12-06","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/lXnaM6JwI8dyrVmNq6Q0NVgSMJ9.jpg","vote_average":7},"11":{"name":"Caminho Sem Arrependimentos","overview":"Depois do funeral de sua mãe, Ittoki toma a decisão sobre o futuro da vila. Infelizmente a maioria não concorda, mas ele parece determinado à seguir com sua escolha.","air_date":"2022-12-13","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/5Lt5Hg9KXi0fgbdnTTE9DPs3Z2A.jpg","vote_average":8},"12":{"name":"O Shinobi Ittoki","overview":"Em um plano ousado, Ittoki decide ir até o QG dos Koga enquanto atacam a Vila Iga. Com a esperança de negociar com Minobe, ele chega à sala de reunião, mas não tem respostas agradáveis.","air_date":"2022-12-20","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/1Sdf3kMiZjgBdxnyxMnrMk23U64.jpg","vote_average":7}}}}},
